$.getJSON('https://kontests.net/api/v1/all', function(data) {
    var text = "";    
    for(var info in data)
    {
        if(data[info].status == "BEFORE")
        {
            text = text + data[info].name + " " + "<br>";
        }
    }
    $(".mypanel").html(text);
});

function App() {
  return 'Hello World';
}

export default App;
